'use strict';

require('plugins/kibana/discover/saved_searches/_saved_search');

require('ui/notify');

var _modules = require('ui/modules');

var _saved_object_loader = require('ui/courier/saved_object/saved_object_loader');

var _saved_object_registry = require('plugins/kibana/management/saved_object_registry');

var _module = _modules.uiModules.get('discover/saved_searches', ['kibana/notify']);

// Register this service with the saved object registry so it can be
// edited by the object editor.
_saved_object_registry.savedObjectManagementRegistry.register({
  service: 'savedSearches',
  title: 'searches'
});

_module.service('savedSearches', function (Promise, config, kbnIndex, createNotifier, SavedSearch, kbnUrl, $http) {
  var savedSearchLoader = new _saved_object_loader.SavedObjectLoader(SavedSearch, kbnIndex, kbnUrl, $http);
  // Customize loader properties since adding an 's' on type doesn't work for type 'search' .
  savedSearchLoader.loaderProperties = {
    name: 'searches',
    noun: 'Saved Search',
    nouns: 'saved searches'
  };

  savedSearchLoader.urlFor = function (id) {
    return kbnUrl.eval('#/discover/{{id}}', { id: id });
  };

  return savedSearchLoader;
});
